import { __decorate } from "tslib";
import { Component } from '@angular/core';
import { COMMA, ENTER } from '@angular/cdk/keycodes';
let OkrFormComponent = class OkrFormComponent {
    constructor(cheetaOkrService, notifications) {
        this.cheetaOkrService = cheetaOkrService;
        this.notifications = notifications;
        this.okr = {
            objective: '',
            actions: [],
            results: ''
        };
        this.separatorKeysCodes = [ENTER, COMMA];
    }
    ngOnInit() {
        // let del =  this.cheetaOkrService.deleteOkr(t.data._id);
    }
    async onSubmit() {
        let body = {
            userId: localStorage.getItem('userId'),
            objective: this.okr.objective,
            actions: [this.okr.actions],
            results: [this.okr.results]
        };
        if (body) {
            await this.cheetaOkrService.createOkr(body);
            this.notifications.openDialog('Updated Succeffully ');
        }
        else {
            this.notifications.openWarningDialog('Error in Updating');
        }
    }
    add(event) {
        const value = (event.value || '').trim();
        if (value) {
            this.okr.actions.push(value);
        }
    }
};
OkrFormComponent = __decorate([
    Component({
        selector: 'app-okr-form',
        templateUrl: './okr-form.component.html',
        styleUrls: ['./okr-form.component.scss']
    })
], OkrFormComponent);
export { OkrFormComponent };
